INSERT INTO cms_descripcionQuehacemos VALUES("2","Dotaciones edit","D´sarach Collection Ltda cuenta con un moderno sistema de impresión digital a gran formato, en el cual puede desarrollar el proceso de sublimación en tamaños hasta de 120 x 90 cm. esto nos permite transformar telas con base 100% poliéster en cualquier tipo de prendas. \n\n\\pGracias a este proceso de impresión (sublimación) también podemos ofrecer la continuidad de los colores institucionales que nuestros clientes manejan dentro de su imagen empresarial o institucional, acompañados de logos corporativos y/o del distintivo de su empresa\n\n/pTeniendo en cuenta lo anterior podemos fabricar blusas, camisetas, esqueletos, pantalones, leggins, faldas, chaquetas, blasones, bufandas, pañoletas, corbatas, pashminas, cinturones, riatas, manillas publicitarias, delantales, pantalonetas, bolsos, maletines, cartucheras, entre otra infinidad de productos textiles con el color diseño e imagen que nuestros clientes deseen.\n\n/pSi tienes alguna idea en mente no dudes en comentárnosla, muy seguramente la podemos hacer realidad.\n\nD´sarach Collection Ltda, también te asesora en cuanto a materiales, diseños, moda en prendas y estilos apropiados para cada tipo de clima o necesidad.\n","","1");
INSERT INTO cms_descripcionQuehacemos VALUES("3"," Proceso de Sublimación Digital:","La Sublimación es un proceso por medio del cual se transferiré una imagen impresa en un papel especial con unas condiciones de calor y de presión adecuadas para que estas se fijen sobre telas o materiales 100% poliéster.","","2");
INSERT INTO cms_descripcionQuehacemos VALUES("4","Estampación","Estampamos con la técnica de sublimación, en la cual podemos garantizar los colores, la estabilidad de los mismos y respectar sus pantones y colores corporativos, sobre telas en base poliéster.","","3");
INSERT INTO cms_descripcionQuehacemos VALUES("5","Plotter de corte con vinilos textiles:","Los vinilos textiles son una alternativa para prendas en algodón o cualquier otro material, que nos permiten hacer logos, dibujos, letreros entre otras opciones por capas, ya que cada vinilo tiene un tono especifico. esta opción nos permite hacer un máximo de 3 o 4 capas de color.","","4");
INSERT INTO cms_descripcionQuehacemos VALUES("6","Dotaciones","D`sarach Collection Ltda se especializa en la elaboraciÃ³n, distribuciÃ³n y venta de Uniformes para el sector de dotaciones empresariales, Hospitalarias, farmacÃ©uticas, y personal ejecutivo, fabricando prendas como: Blusas, Pantalones, faldas, Chaquetas, Sastres, PaÃ±oletas, Bufandas, corbatas, camisas, delantales, petos, camisetas, entre otras prendas exteriores de vestir o en materiales textiles.<br>
\nEn esta lÃ­nea garantizamos nuestra calidad, cumplimiento, flexibilidad y ofrecemos asesorÃ­a creativa cuando el cliente lo solicite en aras de brindar una orientaciÃ³n adecuada para el uso de las prendas de vestir ofreciendo comodidad, toques modernos, acompaÃ±ados de materiales de excelente calidad que garanticen su adecuada conservaciÃ³n ante el uso y lavado frecuente","","5");
INSERT INTO cms_descripcionQuehacemos VALUES("7","Impresión digital textil","Por medio de la tecnología, la impresión digital textil a alcanzado niveles muy altos en definición y en homogeneidad de color, garantizando degrades perfectos en aéreas muy pequeñas, permitiendo el manejo masivo de colores, así como la administración de pantones específicos y manejo de colores neón entre otras opciones, este sistema lo manejamos para telas tipo poliéster. \n\nEn este sentido ofrecemos tanto el papel impreso como el proceso completo de impresión y transferencia del mismo a la tela.\n","","6");



