ion>\n  <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!--[if gte mso 10]>%MINIFYHTML9fde2df83c37ec4ce7aa9e2a039f499070%<![endif]-->","Somos una empresa Colombiana creada desde septiembre de 1988 con sede en la ciudad de Bogotá, Reg. Mercantil No. 346236.\n\nNuestro Principal Objetivo es convertir las necesidades textiles de nuestros clientes en una realidad viable y acorde a su necesidad.\n\nD´Sarach Collection Ltda a lo largo de 25 años de experiencia ha desarrollado como actividad comercial la confección y fabricación de prendas de vestir cómodas con toques modernos, ofreciendo materiales de excelente calidad que garanticen su adecuada conservación ante el uso y lavado frecuente. Sobrepasamos las expectativas de nuestros clientes, entendiendo sus ideas y vistiéndolas.\n\nAsí mismo, cuenta con una línea de producción para la fabricación de 	material promocional textil orientado a cubrir el mercado de BTL, 	ofreciéndoles el desarrollo de prendas de vestir personalizadas para cada 	evento con procesos de sublimación digital textil, estampación, vinilos de 	corte, bordados, apliques entre otras opciones disponibles.\nedit");



